/* eslint-disable react/prop-types */
// @mui material components
import Icon from "@mui/material/Icon";
import IconButton from "@mui/material/IconButton";
import MapIcon from "@mui/icons-material/Map";

// Argon Dashboard 2 MUI components
import ArgonBox from "components/ArgonBox";
import ArgonTypography from "components/ArgonTypography";
import ArgonProgress from "components/ArgonProgress";

// Images
import logoSpotify from "assets/images/small-logos/logo-spotify.svg";
import logoInvesion from "assets/images/small-logos/logo-invision.svg";
import logoJira from "assets/images/small-logos/logo-jira.svg";
import logoSlack from "assets/images/small-logos/logo-slack.svg";
import logoWebDev from "assets/images/small-logos/logo-webdev.svg";
import logoXD from "assets/images/small-logos/logo-xd.svg";

function Completion({ value, color }) {
  return (
    <ArgonBox display="flex" alignItems="center">
      <ArgonTypography variant="caption" color="text" fontWeight="medium">
        {value}%&nbsp;
      </ArgonTypography>
      <ArgonBox width="8rem">
        <ArgonProgress value={value} color={color} variant="gradient" label={false} />
      </ArgonBox>
    </ArgonBox>
  );
}

const action = (
  <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small">
    more_vert
  </Icon>
);

const handleMapClick = (hospitalName) => {
  // Function to handle map icon click
  console.log(`Displaying location for ${hospitalName}`);
  // Add your logic here to display the location
};

const hospitalsTableData = {
  columns: [
    { name: "hospital", align: "left" },
    { name: "budget", align: "left" },
    { name: "status", align: "left" },
    { name: "completion", align: "center" },
    { name: "action", align: "center" },
  ],

  rows: [
    {
      hospital: [
        <ArgonBox display="flex" alignItems="center" key="JMH">
          <ArgonTypography variant="button" fontWeight="bold">
            JMH
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Jos Medical Hospital")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Jos Medical Hospital"
      ],
      budget: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          ₦1,125,000,000
        </ArgonTypography>
      ),
      status: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          operational
        </ArgonTypography>
      ),
      completion: <Completion value={60} color="info" />,
      action,
    },
    {
      hospital: [
        <ArgonBox display="flex" alignItems="center" key="PGH">
          <ArgonTypography variant="button" fontWeight="bold">
            PGH
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Plateau General Hospital")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Plateau General Hospital"
      ],
      budget: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          ₦2,250,000,000
        </ArgonTypography>
      ),
      status: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          fully operational
        </ArgonTypography>
      ),
      completion: <Completion value={100} color="success" />,
      action,
    },
    {
      hospital: [
        <ArgonBox display="flex" alignItems="center" key="JUTH">
          <ArgonTypography variant="button" fontWeight="bold">
            JUTH
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Jos University Teaching Hospital")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Jos University Teaching Hospital"
      ],
      budget: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          ₦1,530,000,000
        </ArgonTypography>
      ),
      status: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          under renovation
        </ArgonTypography>
      ),
      completion: <Completion value={30} color="error" />,
      action,
    },
    {
      hospital: [
        <ArgonBox display="flex" alignItems="center" key="BMH">
          <ArgonTypography variant="button" fontWeight="bold">
            BMH
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Bingham Memorial Hospital")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Bingham Memorial Hospital"
      ],
      budget: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          ₦630,000,000
        </ArgonTypography>
      ),
      status: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          planning phase
        </ArgonTypography>
      ),
      completion: <Completion value={0} color="error" />,
      action,
    },
    {
      hospital: [
        <ArgonBox display="flex" alignItems="center" key="OLA">
          <ArgonTypography variant="button" fontWeight="bold">
            OLA
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Our Lady of Apostles Hospital")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Our Lady of Apostles Hospital"
      ],
      budget: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          ₦6,300,000,000
        </ArgonTypography>
      ),
      status: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          operational
        </ArgonTypography>
      ),
      completion: <Completion value={80} color="info" />,
      action,
    },
    {
      hospital: [
        <ArgonBox display="flex" alignItems="center" key="PMH">
          <ArgonTypography variant="button" fontWeight="bold">
            PMH
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Pankshin Medical Hospital")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Pankshin Medical Hospital"
      ],
      budget: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          ₦1,035,000,000
        </ArgonTypography>
      ),
      status: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          fully operational
        </ArgonTypography>
      ),
      completion: <Completion value={100} color="success" />,
      action,
    },
  ],
};

export default hospitalsTableData;
